import React, { useEffect, useState } from "react"
import "../css/access.css"
import "/home/ubuntu/dev/src/css/fonts.css"

import AccessForm from "./AccessForm.js"

import { BrowserRouter as Router, Redirect, Route, Switch } from "react-router-dom"

export default function Login( props ) {

  const [authenticated, setAuthenticated] = useState( props.status )
  useEffect( () => {
    if ( authenticated ) {
      props.setStatus( true )
      console.log( "Authenticated" )
    }
  }, [authenticated] )

  const Form = () => {
    return (
      <div className="container">
        <div className="main">
          <div className="logo">Paste</div>
          <div className="verDivider"></div>
          <AccessForm
            status={authenticated}
            setStatus={() => { setAuthenticated() }}
          />
        </div>
      </div >
    )
  }

  console.log( "ACCESS" )
  return (
    (
      authenticated ?
        <Redirect to="/frontpage" /> :
        <Form />
    )
  )
}
